import React from 'react';
import Styles from './Header.module.css'
import NavbarBrand from '../Images/navbarBrand.svg'

const Header = () => {
    return (<>
        <nav className="navbar navbar-expand d-flex flex-column align-items-start border">
            <a href="index.js" className="navbar-brand"><img src={NavbarBrand} alt="Logo" className={Styles.navbar_Brand} /></a>
        </nav>
    </>);
}

export default Header;
